import { FiHome, FiMenu } from 'react-icons/fi';
import '../stylesheets/Header.css';

function Header() {
  return (
    <>
      <header>
        <button className="home-btn icon-btn">
          <FiHome />
        </button>
        <button className="menu-btn icon-btn">
          <FiMenu />
        </button>
      </header>
    </>
  );
}

export default Header;
